import { Component } from '@angular/core';

@Component({
  selector: 'app-layout-standard',
  templateUrl: './layout-standard.component.html',
  styleUrls: ['./layout-standard.component.css']
})
export class LayoutStandardComponent {

}


<router-outlet></router-outlet>

<div class="footer-dark" style="padding: 0px;">
    <footer>
        <div class="container">
            <div class="row">
                <div class="col item social"><a href="https://www.facebook.com/" target="_blank"><i class="icon ion-social-facebook"></i></a><a href="https://twitter.com/" target="_blank"><i class="icon ion-social-twitter"></i></a><a href="https://www.linkedin.com/" target="_blank"><i class="icon ion-social-linkedin"></i></a></div>
            </div>
            <p class="copyright">J&amp;J © 2023</p>
        </div>
    </footer>
</div>
